import React from "react";
import Layout from "../Layout";
import PortfolioCard from "../PortfolioCard";
import ImagePic from "../../assets/images/me.jpg";

import "./Portfolio.css";

const Portfolio = () => {
  const portfolios = [
    {
      title: "Facer",
      image: { ImagePic },
      url: "https://google.com",
    },
    {
      title: "Facer",
      image:
        "https://i1.wp.com/catmedia.ie/wp-content/uploads/2017/10/Space-BG-Black.jpg?fit=1200%2C889&ssl=1&w=640",
      url: "https://google.com",
    },
    {
      title: "Facer",
      image:
        "https://lh3.googleusercontent.com/_UjqAwACORK3sj7C2qY1nDciUNSxm0dbp2CjEiJY9v5zk9w3-WPJ_G80X3n5FA5wxOs_nyXUwNbeALnwO9PbByT6u0bQlfbGyCm4FXbmRe3NmiUM1yH6APShOs-h3yGVGLkQyywBisYPXogQdvq07AR59kY-3kbnfiQigAchdzsUGYLHN7gMBiEm0ayl5Brs2ZXim0-l_N4W_-u7N80iuTJVR7TAPfV5WJZqg2JdbRYDYUpf8EnOh_23SHrCPHMWizM4SYDwNsAzNKx5vaigmgzvoWehSvi1Aa93uSVgFVoXt6mq3Aqx7_4Ds94eW-hZbr6M7t-HLWQoQO1NyjibVK8yA5ZjUN8gYRZQeoKHeh9l269D_uANtWlbeLN3q3DacTztiXsgSV3407FV4rWE1V_UmcArpGzjrNPeojl4o_jUZqvGSfTM5A7FtX_HzfIU5WJ32Ug_Dda0X_kOWv5MajpBMpRSvNe2zcfYOS3sc2hw44Bdyv4-bR9nRHevaTzOro-PA2gcBCNpn7N6asSGfgk-iadDNQ0KI4l7PqBT3qN0MA2yWOCCFDv--O4NiC0xqAlPxi8f9BH0OLbANFvmOrp2y0o9Zg4ACg8nwFV3YDGtZn5KOiJJ0o-IiXkwUnYCizNwUiDrPpGmiSKMXs8fKjvSUsrxXn_wOVOv4_GR8BfSmcM5ifKEv3uP6DbR=s321-no?authuser=0",
      url: "https://google.com",
    },
  ];
  return (
    <Layout>
      <div className="Portfolio">
        {portfolios.map((portfolio) => (
          <PortfolioCard
            title={portfolio.title}
            image={portfolio.image}
            url={portfolio.url}
          />
        ))}
      </div>
    </Layout>
  );
};

export default Portfolio;
